gxt(){return"Um W\xe4rme in mechanische Arbeit umzuwandeln, wenden wir den von Gasturbinen bekannten Joule-Prozess an. Allerdings setzen wir diesen Prozess mit einer Kolbenmaschine um, da Kolbenmaschinen eine deutlich h\xf6here Effizienz bei Verdichtung und Expansion bieten, was zu eindr\xfccklichen Umwandlungsraten von W\xe4rme in elektrische Energie f\xfchrt. Dieser Ansatz kann nur mit unseren patentierten vollvariablen Ventilaktuatoren realisiert werden."},
gwF(){return"Unsere USPs"},
gxl(){return"Eine aussergew\xf6hnlich hohe Umwandlungsrate von W\xe4rme in elektrische Energie von 35% bis 45%, was die Ausbeute aus einer gegebenen Menge an W\xe4rme maximiert."},
gxm(){return"Einzigartige dynamische Leistungs- und Temperaturanpassung, die einen zuverl\xe4ssigen und flexiblen Betrieb rund um die Uhr erm\xf6glicht."},
gxn(){return"Skalierbarkeit von wenigen Kilowatt bis zu mehreren Megawatt, ideal f\xfcr dezentrale Stromerzeugung."},
gxo(){return"Platzsparend verpackt in einem 20-Fuss-Container, wird eine einfache Bereitstellung auf dem Werksgel\xe4nde des Kunden erm\xf6glicht."},
gwi(){return"Hauptvorteile"},
