gw5(){return"Erkanntes Problem"},
gw2(){return"Schwerindustrien wie Metall-, Glas- und Zementproduktion sowie aufkommende CO2-negative Pyrolyseprozesse setzen erhebliche Mengen an W\xe4rme frei. Bestehende Technologien k\xf6nnen diese thermische Energie "},
gw3(){return"insbesondere bei Temperaturen zwischen 500 und 900 \xb0C und Leistungen unter f\xfcnf Megawatt nicht effektiv nutzen. Genau in diesem Arbeitsbereich setzt die etavalve-Maschine an."},
gwE(){return"Unsere L\xf6sung"},
gPe(){return u.Z},
gPf(){return"Unsere neue, kolbenbasierte W\xe4rmekraftmaschine ist darauf ausgelegt, nach dem thermodynamischen Joule-Prozess zu arbeiten, auch als Brayton- oder Gasturbinenprozess bekannt. In diesem Prozess wird Luft als Arbeitsmedium komprimiert, dann wird W\xe4rme bei konstantem Druck zugef\xfchrt, und schliesslich wird zur Erzeugung von Arbeit expandiert. In unserem Ansatz werden Kompressor und Expander mit Kolbenmaschinen anstelle von Turbinenr\xe4dern umgesetzt. Im Gegensatz zu Turbomaschinen komprimieren und expandieren Kolbenmaschinen nahezu"},
gPg(){return" isentrop (\u03b7\u22481) selbst bei niedrigen Leistungsstufen und unter Teillastbedingungen. Dadurch kann eine kolbenbasierte Joule-Maschine \xfcber einen weiten Bereich von W\xe4rmemengen und Temperaturen mit aussergew\xf6hnlich hoher Effizienz von 35-45 % betrieben werden. Zudem ist sie hochdynamisch, da Anpassungen in jedem Zyklus vorgenommen werden k\xf6nnen. Dar\xfcber hinaus ist eine Kolbenmaschine \xe4usserst kosteneffizient und kann durch Anpassungen von Drehgeschwindigkeit, Zylindergr\xf6sse und Zylinderzahl auf die gew\xfcnschte Nennleistung skaliert werden."},
gPb(){return u.Z},
gPc(){return"In unserem Ansatz werden Kompressor und Expander mit Kolbenmaschinen anstelle von Turbinenr\xe4dern umgesetzt. Im Gegensatz zu Turbomaschinen komprimieren und expandieren Kolbenmaschinen nahezu isentrop (\u03b7\u22481) selbst bei niedrigen Leistungsstufen und unter Teillastbedingungen. Dadurch kann eine kolbenbasierte Joule-Maschine \xfcber einen weiten Bereich von W\xe4rmemengen und Temperaturen"},
gPd(){return"mit aussergew\xf6hnlich hoher Effizienz von 35-45 % betrieben werden. Zudem ist sie hochdynamisch, da Anpassungen in jedem Zyklus vorgenommen werden k\xf6nnen. Dar\xfcber hinaus ist eine Kolbenmaschine \xe4usserst kosteneffizient und kann durch Anpassungen von Drehgeschwindigkeit, Zylindergr\xf6sse und Zylinderzahl auf die gew\xfcnschte Nennleistung skaliert werden."},
gE7(){return"Die Kerntechnologie"},
gQh(){return"Die\nKerntechnologie"},
gE8(){return"Da der Luftstrom des Kompressors und des Expanders pr\xe4zise koordiniert werden muss, h\xe4ngt die Machbarkeit einer kolbenbasierten Joule-Maschine vom Vorhandensein variabler Ventilaktuatoren ab. Wir haben einen solchen Aktuator entwickelt \u2013 \xe4usserst effizient und mit vollautomatisiertem Bewegungsablauf."},
gQg(){return"Da der Luftstrom des Kompressors und des Expanders pr\xe4zise koordiniert werden muss, h\xe4ngt die Machbarkeit einer kolbenbasierten Joule-Maschine vom Vorhandensein variabler Ventilaktuatoren ab. Wir haben einen solchen Aktuator entwickelt \u2013 \xe4usserst effizient und mit vollautomatisiertem Bewegungsablauf.\n\nDiese patentierte Kerntechnologie erm\xf6glicht eine dynamische Anpassung der Joule-Kolbenmaschine an die gew\xfcnschte Leistung und an Fluktuationen der W\xe4rmequelle \u2013 dies ist bei einer Gasturbine nicht m\xf6glich."},
gms(){return"Wir sind f\xfcr dich da."},
guW(){return"Unser gemeinsamer Weg begann 2015, als wir im akademischen Umfeld an vollvariablen Ventilaktuatoren arbeiteten."},
guX(){return"Seither haben wir verschiedene Prototypen entwickelt und schrittweise verbessert."},
guY(){return"Die Ventilaktuatoren haben Millionen von Zyklen im herausfordernden Umfeld von Verbrennungsmotoren erfolgreich absolviert."},
grV(){return"Heute, als Spin-off der Empa D\xfcbendorf und der ETH Z\xfcrich, widmen wir uns der Pionierarbeit f\xfcr eine neue Maschinenklasse, welche industrielle Abw\xe4rme wirtschaftlich in elektrische Energie umwandelt.\n\nDie Kerntechnologie dieses Vorhabens ist unser patentiertes System zur variablen Ventilbet\xe4tigung."},
gwL(){return"Partner"},
gAX(){return"Seit seiner Bachelorarbeit im Jahr 2015 besch\xe4ftigt er sich mit vollvariablen Ventilaktuatoren. In seiner Masterarbeit lag der Schwerpunkt auf der simulativen Analyse von kolbenbasierten Joule-Maschinen. Schliesslich schloss er seine Dissertation am Institut f\xfcr Regelungssysteme an der ETH Z\xfcrich ab, wo er Forschung zur Modellierung und Optimierung von vollvariablen Ventilaktuatoren in Verbrennungsmotoren betrieb."},
gEz(){return"Im Jahr 1992 war er Teil des ETH-Teams unter Prof. M.K. Eberle, das eine entscheidende Rolle beim Durchbruch des vergleichsweise CO2- und emissionsarmen CommonRail-Dieselmotors spielte. Sein Patent f\xfcr die Pumpensteuerung wird noch heute in 80% der Diesel-Personenkraftwagen verwendet. Nach der Leitung des ersten CommonRail-Einspritzsystem-Projekts bei der MTU-Tochtergesellschaft l'Orange hatte er verschiedene F\xfchrungspositionen in der Hydraulikindustrie inne und arbeitete als Berater."},
