gw2(){return"Heavy industries such as metal, glass, and cement production, as well as emerging CO2-negative pyrolysis processes, release significant amounts of heat during their operations. Existing technologies are unable to effectively utilize this thermal energy, "},
gw3(){return"especially at temperatures between 500 and 900 \xb0C and power levels below five megawatts. This is exactly the operating range that the etavalve engine aims to address."},
gwE(){return"Our Solution"},
gPe(){return"Our new piston-based thermal engine is designed to operate using the well-known Brayton cycle, also known as Joule cycle or gas turbine process. In this cycle, air as a working fluid is compressed, then heat is added at a constant pressure, and finally, it is expanded to generate work. However, in our approach, compressors and expanders will be implemented using piston machines instead of turbine wheels."},
gPf(){return"Our new piston-based thermal engine is designed to operate using the well-known Brayton cycle, also known as Joule cycle or gas turbine process. In this cycle, air as a working fluid is compressed, then heat is added at a constant pressure, and finally, it is expanded to generate work. However, in our approach, compressors and expanders will be implemented using piston machines instead of turbine wheels. Unlike turbomachinery, piston machines compress and expand nearly"},
gPg(){return"isentropically (\u03b7\u22481) even at low power levels and under partial load conditions. Consequently, a a piston-based Brayton engine can be operated with exceptionally  high efficiency over a wide range of heat amount and temperature, typically between 35% and 45%, and it is highly dynamic, as adjustments can be made in each cycle. Furthermore, a piston machine is extremely cost-effective and can be scaled to a desired rated power level through adjustments in speed, cylinder size, and the number of cylinders."},
gPb(){return"Our new piston-based thermal engine is designed to operate using the well-known Brayton cycle, also known as Joule cycle or gas turbine process. In this cycle, air as a working fluid is compressed, then heat is added at a constant pressure, and finally, it is expanded to generate work. However, in our approach, compressors and expanders will be"},
