gE7(){return"The Core Technology"},
gQh(){return"The Core\nTechnology"},
gE8(){return"As the airflow of the compressor and the expander must be precisely coordinated, the feasibility of a piston-based Brayton engine relies on the implementation of a variable valve actuator. We have developed such an actuator \u2013 highly efficient and fully automated."},
gQg(){return"As the airflow of the compressor and the expander must be precisely coordinated, the feasibility of a piston-based Brayton engine relies on the implementation of a variable valve actuator. We have developed such an actuator \u2013 highly efficient and fully automated. This patented core technology allows the piston-based Brayton engine, unlike the gas turbine, to dynamically adjust to the desired power and to fluctuations of the heat source."},
gms(){return"We are here for you."},
guW(){return"We began our journey in 2015, working on our core technology, the variable valve actuation system, within an academic setting."},
guX(){return"Since then, we have developed various prototypes, continually enhancing them with each iteration. "},
guY(){return"The valve actuators have been successfully in operation for millions of cycles in the challenging environment of fired internal combustion engines."},
grV(){return"Today, as a spin-off of Empa D\xfcbendorf and ETH Zurich, we are dedicated to pioneering a new class of machines that economically convert industrial waste heat into electrical energy. \n\nThe core technology required for this endeavor is our patented variable valve actuator system."},
gwL(){return"Partners"},
gAX(){return"Since his bachelor's thesis in 2015, he has been involved with fully variable valve actuators. His master's thesis focused on the simulative analysis of Brayton piston-based engines. Finally, he completed his dissertation at the Institute for Control Systems at ETH Zurich, where he conducted research on the modeling and optimization of fully variable valve actuators in internal combustion engines."},
gEz(){return"In 1992, he was part of the ETH team under Prof. M.K. Eberle, which played a crucial role in the breakthrough of the comparably low-emission and CO2-reducing CommonRail Diesel engine. His pump control patent is still being used in 80% of passenger vehicles today. After leading the first CommonRail injection system at MTU subsidiary l'Orange, he held various leadership positions in the hydraulic industry and worked as a consultant."},
